package com.jsp.studyShare.model;public class Email {    private int eid;    private String email;    private int code;    private String openid;    public int getEid() {        return eid;    }    public void setEid(int eid) {        this.eid = eid;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public int getCode() {        return code;    }    public void setCode(int code) {        this.code = code;    }    public String getOpenid() {        return openid;    }    public void setOpenid(String openid) {        this.openid = openid;    }}